public class Solution {
    public string MaximumOddBinaryNumber(string s) {
        int onesCount = 0;
        // Count the number of '1's in the input string
        foreach (char c in s) {
            if (c == '1') {
                onesCount++;
            }
        }

        // If all characters are '1's, just return the string as it is but ensure the last character is '1'
        if (onesCount == s.Length) {
            return s;
        }

        // Create a new string with all '1's except the last one, which should be '1'
        // This ensures the maximum odd number. The rest are filled with '0's up to the length of the original string
        return new string('1', onesCount - 1) + new string('0', s.Length - onesCount) + '1';
    }
}
